script: |
  super -f text -I q12652.spq | sort > q12652.out

inputs:
  - name: q12652.spq
    data: |
      SELECT DISTINCT + 5 / col2 + 77 * - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 NOT BETWEEN ( + - 82 * col2 + - col0 + col2 * + col2 - col0 ) AND col1;
  - name: tab1

outputs:
  - name: q12652.out
    data: |
